import { useState } from "react";
import data from "../../utils/constants/provinces";
import styles from "./Provinsi.module.css";
import React from 'react';
import detailProv from "../detailProv";

function Provinsi() {
    const [tableData, setTableData] = useState(data);
    return (
        <div className={styles.table}>
            <table>
                <thead>
                    <tr>
                        <th>No</th>
                        <th>Kota</th>
                        <th>Kasus</th>
                        <th>Sembuh</th>
                        <th>Dirawat</th>
                        <th>Meninggal</th>
                    </tr>
                </thead>
                <tbody>
                    {tableData.map(function(data){
                        return <detailProv key = {data.kota} data = {data}/>
                    })}
                </tbody>
            </table>
        </div>
    );
}

export default Provinsi;
